import { Grid } from '@mui/material';
import Item from 'antd/lib/list/Item';
import React from 'react';
import Cardone from './Cardone';

const Grid2 = () => {
  return (

    <Grid container spacing={2}>
  <Grid xs={8}>
    <Item><Cardone/></Item>
  </Grid>
  <Grid xs={4}>
    <Item>xs=4</Item>
  </Grid>
  <Grid xs={4}>
    <Item>xs=4</Item>
  </Grid>
  <Grid xs={8}>
    <Item>xs=8</Item>
  </Grid>
</Grid>
  );
};

export default Grid2;
